import { PRODUCT_CATERGORIES } from "../types";

const productCategories = [
  {
    category: "menClothing",
    value: "men clothing",
  },
  {
    category: "womenClothing",
    value: "women clothing",
  },
  {
    category: "jewelery",
    value: "jewelery",
  },
  {
    category: "electronics",
    value: "electronics",
  },
];

const productCategoryReducer = (state = productCategories) => {
  return state;
};

export default productCategoryReducer;
